jump_counter: .word 0
promptA: .asciiz "crab fall here"
.eqv FRAME_BASE 0x10008000
.eqv MAX_ADDRESS 0x1004049C
#.eqv MS_PER_FRAME 33
.eqv FRAME_HEIGHT 512
.eqv FRAME_WIDTH 512





.eqv RED 0x00ee1420
.eqv BLACK 0x00000001
.eqv BACKGROUND_BLUE 0x0096d9e9
.eqv GRAVITY 1
.eqv VELOCITY 5
.eqv BOTTOM_GREATER_THAN 60928 #LAST ROW INDEX - HEIGHT
.eqv INIT_CRAB_POS 55828 #change later



.text
main: ### $t9 stores current, $t8 stores previous
	li $t9, FRAME_BASE # $t9 stores graph top left corner address
	
	
	### initial crab position 
	#li $t0, INIT_CRAB_POS
	#add $t9, $t9, $t0
	addi $t9, $t9, 4
	
	#initial drawings
	jal set_screen_BACKGROUND
	
	la $a0, promptA ## debugger
	li $v0, 4
	syscall 
	
	jal loadCrabColours
	j GAME_LOOP
	
	j END
	

############ CHECK COLLISIONS######################	 #gravity and damage
### CHECK BOTTOM COLLISION
CHECK_BOTTOM_COLLISIONS:
	add $t0, $t9, $zero #t9 has top left corner
	### store address of bottom row in t0
	addi $t0, $t9, 4096
	#t1 for left foot pixel underneath, #t2 for right foot pixel underneath
	addi $t1, $t0, 4
	addi $t2, $t0, 48
	#t3, if left is not blue 
	lw $t3, 0($t1)
	li $t4, BACKGROUND_BLUE
	beq $t3, $t4, if_left_floating
	jr $ra
if_left_floating:
	lw $t3, 0($t2)
	beq $t3, $t4, DO_GRAVITY
	jr $ra


	
###### CHECK KEY_PRESSED #######################
CHECK_KEY_PRESSED:
	li $t1, 0xFFFF0000  
	lw $t2, 0($t1) 
	bne $t2, 1, end_if_keypressed_happened  
	lw $t0, 4($t1) # this assumes $t1 s set to 0xfff0000 from before
	###print int result of A+42
	li $v0, 1
	move $a0, $ra
	syscall
	### check wasd keys
	beq $t0, 100, if_d_pressed
	j end_if_keypressed_happened

if_d_pressed:
	jal move_RIGHT
	j end_if_keypressed_happened

do_jump:
	### move crab

end_if_keypressed_happened:
j NO_CHANGE
	
	
GAME_LOOP:
	jal CHECK_BOTTOM_COLLISIONS
	j CHECK_KEY_PRESSED
NO_CHANGE:
	jal loadCrabColours
	
	### sleep frame rate
	li $v0, 32
	li $a0, 1000 #MAINTAIN STABLER FRAME RATE
	syscall
	j GAME_LOOP


DO_GRAVITY:
	
	li $t0, GRAVITY
	li $t1, FRAME_WIDTH
	mult $t0, $t1
	mflo $t1
	add $t8, $t9, $zero #save last position
	add $t9, $t9,$t1 #lower crab
	j eraseCrab #draw crab jumps back to game loop

	

set_screen_BACKGROUND:
	la $t3, background
	li $t0, FRAME_BASE
	addi $t2, $t0, 70559 #max address
	j setPixel_SCREEN


setPixel_SCREEN:
	lw $t1, ($t3)
    	sw $t1, 0($t0) # set $t2 to white
   	addi $t0, $t0, 4 # increment $t2 to next index
    	addi $t3, $t3, 4 #increment background to next value
    	ble $t0, $t2, setPixel_SCREEN #$t2 is adress of bottom right corn of the image
    	jr $ra 
	

move_RIGHT:
	add $t8, $t9, $zero #save last position
	addi $t9, $t9, 4 #move right
	j eraseCrab

eraseCrab:
	li $t0, BACKGROUND_BLUE
	li $t2, BACKGROUND_BLUE
	li $t3, BACKGROUND_BLUE
	add $t7, $t8, $zero #copy prev. crab position
	j Draw_Crab

loadCrabColours:	
	li $t3, 0x00000000 #load black
	li $t2, 0x00ff7b00 #load orange
	li $t0, 0x00ee1420 # load red
	add $t7, $t9, $zero #copy current crab position
	j Draw_Crab


Draw_Crab:	
	sw $t0, 0($t7)
